import React, { Component } from 'react'

class Databinding extends Component {
    fullName = "Hiếu Đặng";
    age = 18;
  render() {
    return (
      <div>
        <h1>Tên: {this.fullName}</h1>
        <h2>Tuổi: {this.age}</h2>
      </div>
    )
  }
}
export default Databinding;
